import React from 'react';
import {Form} from 'react-bootstrap';
import Modalmodal from '../Modal/Modal';
import Rating from '../Rating/Rating';

const reviewForm = props => (
    props.postReviewEditing ? (
    <Modalmodal
      title="Review this post"
      acceptEnabled={props.reviewIsValid}
      onCancelModal={props.cancelReviewHandler}
      onAcceptModal={props.acceptReviewHandler}
      isLoading={false}>
      <Form>
        <Rating
          id="Rating"
          label="Rate this location: "
          onChange={props.postRatingChangeHandler}
          value={props.rating}
        />
      </Form>
    </Modalmodal>) : null
);

export default reviewForm;
